import css from "styled-jsx/css";

export const cardStyles = css.global`
    .card-container{
      width: 5%
      padding: 10%;
      margin: auto;
      border: solid;
    }

    .photo{
      width: 5%;
    }

    .title{
      text-align: center;
    }

    .quote{
      width: 75%;
      text-align: center;
    }
  }
`;
